 niño. Al mismo tiempo que se ve afectada por los cambios hormonales y posibles sentimientos contradictorios, también es posible que se encuentre cansada y preocupada por su responsabilidad maternal o por el desarrollo general del niño',1,'FINAL','VIDEO','http://es.wikipedia.org/wiki/Depresi%C3%B3n_postparto',NULL,NULL,'',2,-1,-1,4),(5,'La DEPRESIÓN POSTPARTO es un problema que afecta madres primerizas en los primeros 6 meses después del parto',1,'FINAL','LINK','http://es.wikipedia.org/wiki/Depresi%C3%B3n_postparto',NULL,NULL,'',2,-1,-1,5),(6,'pregunta 6',1,'ASSERTIVE',NULL,NULL,NULL,NULL,NULL,1,7,8,6),(7,'PREGUNTA 7',1,'ASSERTIVE',NULL,NULL,NULL,NULL,NULL,1,-1,-1,7),(8,'PREGUNTA 8',1,'ASSERTIVE',NULL,NULL,NULL,NULL,NULL,1,-1,-1,6);
